def ClumpFind(text, k, L, t):
	ClumpPatterns = []
	ClumpPattDuplicate = []
	CountTot = []
	Count = [None]*(L-k)
	for i in range(len(text)-L):
		for j in range(L-k):
			pattern = Text(j,k,text)
			Count[j] = PatternCount(text[i:i+L],pattern)
		for n in range(len(Count)):
			if Count[n] >= t:
				ClumpPattDuplicate.append(Text(n,k,text))
		#print(Count)
	#print(ClumpPattDuplicate)
	for x in ClumpPattDuplicate:
		if x not in ClumpPatterns:
			ClumpPatterns.append(x)
	return ' '.join([str(i) for i in ClumpPatterns])


